import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<${scopeTag("ui5-li-custom", tags, suffix)} id="${ifDefined(context._id)}" class="${ifDefined(context.overflowClasses)}" type="${ifDefined(context.overflowState)}" ?selected="${context.effectiveSelected}" ?disabled="${context.effectiveDisabled}" aria-disabled="${ifDefined(context.effectiveDisabled)}" aria-selected="${ifDefined(context.effectiveSelected)}" aria-labelledby="${ifDefined(context.ariaLabelledBy)}"><div class="ui5-tab-overflow-itemContent">${ context.icon ? block1(context) : undefined }${ifDefined(context.text)}${ context.additionalText ? block2(context) : undefined }</div></${scopeTag("ui5-li-custom", tags, suffix)}>`; };
const block1 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} name="${ifDefined(context.icon)}"></${scopeTag("ui5-icon", tags, suffix)}>`; };
const block2 = (context) => { return html` (${ifDefined(context.additionalText)}) `; };


	return block0(context);
};

export default main;
